export const headerData = [
    {id: 1, value: "Home", link: "/"},
    {id: 2, value: "About", link: "/About"},
    {id: 3, value: "Contact", link: "/Contact"}
];

export const bannerImageUrl = "https://pacinst.org/wp-content/uploads/2020/01/cornfield-compressed.jpg";

export const schemeData = {
    headingNews: "All registration will be accepted between 9am to 6pm",
    subHeading: "इसतरह हम अपने वेबसाइट पे हिंदी पैराग्राफ ऐड कर सकते है | इससे ज्यादा डिटेल में Quora पे नहीं लिख सकता मित्रो | अगर आपको और डिटेल में उत्तर चाहिए तो मेरा Youtube Channel like करे और Subscribe करे | मै आपको पूरा टुटोरिअल बनके देखूँगा की पूरी डायनामिक साईट कैसे बनायीं जाती है और साईट को हम मल्टीप्ल भाषा में कैसे शो करसकते है | लिंक पोस्ट के अंत में है ( Techno Sandy ) . उमीद है की आपको मेरा उत्तर पसंद आएगा !",
    scheme: [{
        id: 1,
        schemeName: "Register Farmer",
        schemeTotal: 34256,
        buttonName: "Register"
    }, {
        id: 2,
        schemeName: "Pradhan Mantri Krishi Sinchai Yojana",
        schemeTotal: 997757,
        buttonName: "Register"
    }, {
        id: 3,
        schemeName: "Paramparagat Krishi Vikas Yojana",
        schemeTotal: 75463,
        buttonName: "Register"
    }, {
        id: 4,
        schemeName: "Gramin Bhandaran Yojna",
        schemeTotal: 988786,
        buttonName: "Register"
    }]
}
